import UploadFileComponent from './uploadFile';
import ViewComponent from './View';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to the File Upload and View Application</h1>
      </header>
      <UploadFileComponent />
      <ViewComponent />
    </div>
  );
}

export default App;
